L.geoJSON(bairros).addTo(mapid);

function getColor(d) {
  return d > 1000
    ? "#800026"
    : d > 500
    ? "#BD0026"
    : d > 200
    ? "#E31A1C"
    : d > 100
    ? "#FC4E2A"
    : d > 50
    ? "#FD8D3C"
    : d > 20
    ? "#FEB24C"
    : d > 10
    ? "#FED976"
    : "#FFEDA0";
}

function style(feature) {
  return {
    fillColor: getColor(feature.properties.INFECTADOS),
    weight: 2,
    opacity: 0.5,
    color: "white",
    dashArray: "3",
    fillOpacity: 0.8,
  };
}

L.geoJson(bairros, { style: style }).addTo(mapid);

function highlightFeature(e) {
  var layer = e.target;

  layer.setStyle({
    weight: 5,
    color: "#666",
    dashArray: "",
    fillOpacity: 1,
  });

  if (!L.Browser.ie && !L.Browser.opera && !L.Browser.edge) {
    layer.bringToFront();
  }
  
}



// ... our listeners
function resetHighlight(e) {
  geojson.resetStyle(e.target);
  
}

geojson = L.geoJson();

function zoomToFeature(e) {
  mapid.fitBounds(e.target.getBounds());
}

function onEachFeature(feature, layer) {
  layer.on({
    mouseover: highlightFeature,
    mouseout: resetHighlight,
  }).bindPopup(function (layer) {
    return layer.feature.properties.description;
})
}

geojson = L.geoJson(bairros, {
  style: style,
  onEachFeature: onEachFeature,
}).addTo(mapid);



var legend = L.control({ position: "bottomright" });

legend.onAdd = function (mapid) {
  var div = L.DomUtil.create("div", "info legend"),
    grades = [0, 10, 20, 50, 100, 200, 500, 1000],
    labels = [];

  // loop through our density intervals and generate a label with a colored square for each interval
  for (var i = 0; i < grades.length; i++) {
    div.innerHTML +=
      '<i style="background:' +
      getColor(grades[i] + 1) +
      '"></i> ' +
      grades[i] +
      (grades[i + 1] ? "&ndash;" + grades[i + 1] + "<br>" : "+");
  }

  return div;
};

legend.addTo(mapid);
